#! /usr/local/bin/python3
from typing import List


def subarraysDivByK_slow(A: List[int], K: int) -> int:
    n = len(A)
    dp = [0] * n
    for i in range(n):
        summ = 0
        count = 0
        for j in range(i, -1, -1):
            summ += A[j]
            if summ % K == 0:
                count += 1
        dp[i] = dp[i - 1] + count
    # print(dp)
    return dp[-1]


def subarraysDivByK_slow2(A: List[int], K: int) -> int:
    n = len(A)
    dp = [0] * (n + 1)
    count = 0
    for i in range(n):
        for j in range(n - 1, i - 1, -1):
            dp[j] = dp[j - 1] + A[j]
            if dp[j] % K == 0:
                count += 1
    # print(dp)
    return count


# Congruence theoremï¼š if a % m == b % m then (a - b) % m == 0
# pre[i] = A[0] + A[1] + ... + A[i]     # pre represents prefix sum
# sum(i, j) = pre[j] - pre[i]           # i, j are head and tail of sub array
# sum(i, j) % K == 0 equals (pre[i] - pre[j]) % K == 0 equals pre[i] % K == pre[j] % K
# hence, when congruence happens, the sub array sum is divisible by K
# a dictionary is used a counter, pre[i] % K is key, its occurs time is value
def subarraysDivByK(A: List[int], K: int) -> int:
    n = len(A)
    count = pre = 0
    dic = {0: 1}                    # first pre is 0, pre % K is 0, occurs time is 1
    for i in range(n):
        pre += A[i]                 # count prefix sum
        if pre % K in dic:          # if congruence occurs
            count += dic[pre % K]   # add occurs to counter
            dic[pre % K] += 1
        else:
            dic[pre % K] = 1
    # print(dic)
    return count


